import logo from './logo.svg';
import './App.css';
import { useState } from 'react'

export default function App() {
  const [count, setCount] = useState(5);

  function incrementCount() {
    setCount(count + 1);
  } 

  return (
    <div className="App">
      <div>
        <h1>{count}</h1>
      </div>
      <div>
        <img src={logo} className='App-logo' alt='react logo'></img>
      </div>
      <div>
      </div>
      <MyButton count={count} onClick={incrementCount} />
      <MyButton count={count} onClick={incrementCount} />
    </div>
  );
}
function MyButton(count, onClick) {
  return (
    <button className="Button" onClick={onClick}>I'm a button and i clicked {count} times</button>
  );
}



